import React from "react";
import { Text, View } from "react-native";

function UserScreen() {
  return (
    <View style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
      <Text>You are a User</Text>
    </View>
  );
}

export default UserScreen;
